function Planner() {
  return (
    <div style={{
      backgroundColor: "#dbeeff",
      border: "5px solid #003366",
      minHeight: "100vh",
      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "left",
      fontFamily: "Arial, sans-serif",
      textAlign: "center"
    }}>
        <h1>FINANCIAL PLANNER</h1>
        
        {/* Email input */}
        <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
            }}
        />

        {/* Username input */}
        <input
        type="username"
        placeholder="Username"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{
            marginTop: "20px",
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "1px solid #003366",
            width: "250px"
        }}
        />

        {/* Password input */}
        <div style={{ position: "relative", marginTop: "20px" }}>
          <input
            type={showPassword ? "text" : "password"}
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={{
              padding: "10px",
              fontSize: "16px",
              borderRadius: "6px",
              border: "1px solid #003366",
              width: "250px", // same width as email/username
              textAlign: "left",
            }}
          />
          <button
            type="button"
            onClick={() => setShowPassword(!showPassword)}
            style={{
              position: "absolute",
              right: "-70px", // adjust so it sits just outside the input
              top: "50%",
              transform: "translateY(-50%)",
              padding: "6px 10px",
              backgroundColor: "#003366",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer",
              fontWeight: "bold",
            }}
          >
            {showPassword ? "Hide" : "Show"}
          </button>
        </div>

        {/* Confirm Password Input */}
        <div style={{ position: "relative", marginTop: "20px" }}>
          <input
            type={showConfirmPassword ? "text" : "password"}
            placeholder="Confirm Password"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            style={{
              padding: "10px",
              fontSize: "16px",
              borderRadius: "6px",
              border: "1px solid #003366",
              width: "250px", // same as above
              textAlign: "left",
            }}
          />
          <button
            type="button"
            onClick={() => setShowConfirmPassword(!showConfirmPassword)}
            style={{
              position: "absolute",
              right: "-70px",
              top: "50%",
              transform: "translateY(-50%)",
              padding: "6px 10px",
              backgroundColor: "#003366",
              color: "white",
              border: "none",
              borderRadius: "6px",
              cursor: "pointer",
              fontWeight: "bold",
            }}
          >
            {showConfirmPassword ? "Hide" : "Show"}
          </button>
        </div>

        {/* Register Button */}
        <button
        onClick={handleRegister}
        style={{
            marginTop: "20px",
            padding: "12px 24px",
            backgroundColor: "#003366",
            color: "white",
            borderRadius: "6px",
            fontSize: "16px",
            cursor: "pointer"
        }}
        >
        Register
        </button>
    
        {/* Login link */}
        <p style={{ marginTop: "16px", fontSize: "14px" }}>
            <Link to="/" style={{
            color: "#003366",
            textDecoration: "underline",
            cursor: "pointer",
            fontWeight: "bold"
            }}>
            Already have an account? Login
            </Link>
        </p>

        {/* Error Message */}
        {error && (
          <p style={{ color: "red", marginTop: "10px", fontWeight: "bold" }}>
            {error}
          </p>
        )}
    </div>
  );
}

export default Planner;
